const { Option } = components;
const IconOption = props => (
    <Option {...props} className="itemoption">
        <img
            src={props.data.icon}
            style={{ height: (props.data.label=="Imbued heart" || props.data.label == "Garden pie") ? 15 : 25, position: "relative", bottom: 0 }}
            alt={props.data.label}
            loading="lazy"
        />
        <span style={{ marginLeft: "5px" }}>{props.data.label}</span>
    </Option>
);

const CustomSelectValue = props => (
    <div>
        <img
            src={props.data.icon}
            style={{ height: (props.data.label=="Imbued heart" || props.data.label == "Garden pie") ? 15 : 20, position: "relative", bottom: -2 }}
            alt={props.data.label}
            loading="lazy"
        />
        <span style={{ marginLeft: "5px" }}>{props.data.label}</span>
    </div>
)

const customStyles = {
    option: (provided, state) => ({
        ...provided,
        color: state.isSelected ? 'black' : 'black',
        backgroundColor: state.isSelected ? '#b3b3b3' : 'white'
    })
}

const BoostsDropdown = (props) => {
    return (
        <div className="boosts-dropdown">
            <div style={{ textAlign: 'center', color: 'rgb(207, 207, 207)' }}>Select boost</div>
            <div style={{ textAlign: 'center', width: '210px', margin: 'auto', fontSize: '11px' }}>
                <Select
                    value={props.selectedBoost == "str" ? props.str
                        : props.selectedBoost == "att" ? props.att
                        : props.selectedBoost == "def" ? props.def
                        : props.selectedBoost == "ran" ? props.ran
                        : props.selectedBoost == "mag" ? props.mag
                        : props.selectedBoost == "other" ? props.other
                        : null}
                    // defaultValue={options[0]}
                    options={props.selectedBoost == "str" ? strBoosts
                        : props.selectedBoost == "att" ? attBoosts
                        : props.selectedBoost == "def" ? defBoosts
                        : props.selectedBoost == "ran" ? rangeBoosts
                        : props.selectedBoost == "mag" ? mageBoosts
                        : props.selectedBoost == "other" ? otherBoosts
                        : null}
                    components={{ Option: IconOption, SingleValue: CustomSelectValue }}
                    styles={customStyles}
                    onChange={props.selectedBoost == "str" ? props.selectStr.bind(this)
                        : props.selectedBoost == "att" ? props.selectAtt.bind(this)
                        : props.selectedBoost == "def" ? props.selectDef.bind(this)
                        : props.selectedBoost == "ran" ? props.selectRang.bind(this)
                        : props.selectedBoost == "mag" ? props.selectMag.bind(this)
                        : props.selectedBoost == "other" ? props.selectOther.bind(this)
                        : null}
                />
            </div>
        </div>
    )
}

export default BoostsDropdown